import React from 'react';
import {VideoPreview} from '../../containers/VideoPreview/VideoPreview';
import {VideoGrid} from '../../containers/VideoGrid/VideoGrid';
import './Home.scss';

export class Home extends React.Component {
	render() {
		return (
			<div className='home'>
				<VideoGrid/>
			</div>
		)
	}
}

export default Home;
